import {useEffect, useState} from "react"
import Post from "./Post"
import PostsList from "./PostsList"

const Home = (user) => {
    const [data, setData] = useState([])

    useEffect(() => {
        fetch("/api/posts")
            .then(response => response.json())
            .then(json => setData(json))
    }, [])

    return (
        <div>
            <h2>Welcome to CodeShare</h2>
            <h3>Posts</h3>
            <PostsList/>
        </div>
    )
}

export default Home;
